/* eslint-disable react-hooks/rules-of-hooks */
import axios from "axios"

export const fetchSearchData = () => {
    const url = 'https://api-r1.tagalys.com/v1/search?';
    const options = {
        method: 'POST',
        mode: 'no-cors',
        // params: {
        //     q: 'tops',
        //     page: '1'
        // },
        // Body: {
        //     'per_page': 16,
        //     'client_code': '92D5626DBFD74912',
        //     'api_key': '5dff8cbc1c833937d5b6ff490de6639b',
        //     'store_id': '77435339050',
        // }
        headers: {
            "Access-Control-Allow-Origin": 'http://localhost:3001',
            "Access-Control-Allow-Methods": "GET,PUT,POST,DELETE,PATCH,OPTIONS"
          }
    };


    const response = axios.post('https://api-r1.tagalys.com/v1/search?q=tops&page=1', options);
    console.log(response);

}
